import React from 'react';

import {useState} from 'react'

const Doctor = ()=> {
  const [sidebarOpen, setSidebarOpen] = useState(false);

  const openSidebar = () => {
    setSidebarOpen(true);
  }

  const closeSidebar = () => {
    setSidebarOpen(false);
  }

  return (
    <div className="container">
      <h1>Doctor Dashboard</h1>
    </div>
  )
}

export default Doctor;
